import React from 'react';
import Sdata from './Sdata';
import Card from './Card';

const App = () => (
  <>
    <h1 className='heading'>Best Web Series</h1>
    {Sdata.map((val, index) => {
      return (
        <Card
          key={Sdata.id}
          simg={Sdata.simg}
          sname={Sdata.sname}
          stitle={Sdata.stitle}
          slink={Sdata.slink}
        />
      );
    })}
  </>
);

export default App;
